import React from 'react';
import Header from '../src/components/Header'
import Announcements from './Announcements'; // Import the Announcements component
import Assignments from './Assignments'; // Import the Assignments component
import Resources from './Resources'; // Import the Resources component
import Footer from './Footer'; // Import the Footer component

function App() {
  return (
    <div className="App">
      <Header />
      <h1>Announcements</h1>
      <Announcements />

      <h2>Assignments</h2>
      <Assignments />

      <h2>Resources</h2>
      <Resources />

      <Footer />
    </div>
  );
}

export default App;
